import axios from 'axios';

const API_URL = 'https://dev.konfhub.com/konfhub-frontend-evaluation-task';

export const fetchEvents = async () => {
  try {
    const response = await axios.get(API_URL);
    console.log("Full API response:", response); // Log the full response
    if (response.data && Array.isArray(response.data.events)) {
      return response.data.events;
    } else {
      console.error("API response does not contain an events array:", response.data);
      return [];
    }
  } catch (error) {
    console.error("Error fetching data:", error);
    throw error;
  }
};
